import { Text, TouchableOpacity, View } from 'react-native';
import styles from '../styles/ButtonStyle';

const AppButton= () => {
  return (
    <View>
      <TouchableOpacity style={styles.appButtonContainer}>
          <Text style={styles.appButtonText}></Text>
      </TouchableOpacity>
    </View>
  )
}
export default AppButton;
